"use strict";function loadDoc(){var n=new XMLHttpRequest;n.onload=function(){this.readyState==4&&this.status==200&&(document.getElementById("demo").innerHTML=this.responseText)};n.open("GET","Content/txt/TextFile1.txt",!0);n.send()}function loadXML(){const n=new XMLHttpRequest;n.onload=function(){const i=this.responseXML,t=i.getElementsByTagName("ARTIST");let n="";for(let i=0;i<t.length;i++)n=n+t[i].childNodes[0].nodeValue+"<br>";document.getElementById("demo").innerHTML=n};n.open("GET","Content/txt/XMLFile1.xml");n.send()}let PageIndex=1;$("#btnViewMore").click(function(){$.ajax({type:"POST",url:"/home/fetchData/",data:{PageIndex:PageIndex++},cache:!1,success:function(n){n.html!=null&&n.remain>=0&&($(".grid-container").append(n.html),n.remain==0&&$("#btnViewMore").remove())}})});$("#btn-search").click(function(){alert("btn-seach clicked")});